 @PaulistaTradicional  todo mundo viu, mas a máfia do apito é canalha demais pra marcar e conta com a pilantragem da imprensa pra camuflar.
Mesmo com muitas limitações no elenco, Grêmio disputando de igual pra igual com clubes que gastam muito mais e ainda tem que derrotar a roubalheira do apito toda hora. 
TÁ NA HORA DE ALGUÉM PAGAR POR ISSO!!!!

 @kleberdlani7666  infelizmente eu concordo. Era só ter vencido. Os resultados ajudarem.

Vou dá um tempo se futebol. Sério. 
Não tenho paciência para ladainha de jornalista. E eu não vou comemorar vaga para libertadores sendo que o título estava tão perto. Não importa se o Grêmio veio da B, C ou D.
